import React from "react";
import { Form, Input } from "antd";

const dummy = {
	isLoggedIn: true,
	imagePaths
};

const Home = () => {
	return (
		<div>
			{dummy.isLoggedIn && (
				<Form encType="multipart/form-data">
					<Input.TextArea
						maxLength={140}
						placeholder="몬가 일어나고 있습니다"
					/>
					<div>
						<input type="file" multiple hidden />
						<Button>이미지 업로드</Button>
						<Button
							type="primary"
							style={{ float: "right" }}
							htmlType="submit"
						>
							짹짹
						</Button>
					</div>
					<div>
						{dummy.imagePaths.map((v, i) => {
							return (
								<div
									key={v}
									style={{ display: "inline-block" }}
								>
									<img
										src={"http://localhost:3065/" + v}
										style={{ width: "200px" }}
										alt={v}
									/>
									<div>
										<Button>제거</Button>
									</div>
								</div>
							);
						})}
					</div>
				</Form>
			)}
		</div>
	);
};

export default Home;
